/*
 https://leetcode.com/problems/longest-substring-without-repeating-characters/
 
 Given a string, find the length of the longest substring without repeating characters. For example, the longest substring without repeating letters for "abcabcbb" is "abc", which the length is 3. For "bbbbb" the longest substring is "b", with the length of 1.
 
 */

#include <iostream>
#include <vector>
using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        if(s.size() == 0) return 0;
        
        int position[256];
        int startIndx = 0;
        int max = 0;
        int maxLength = -1;
        
        memset(position, 0xff, sizeof(position));
        
        for(int i=0; i<s.size(); i++){
            char ch = s[i];
            int indx = ch;
            if(indx >= 256){
                printf("Beyond the range");
                return -1;
            }
            if(position[indx] < startIndx){
                max++;
            }
            else{
                
                //Record the old max length substring;
                if(max > maxLength){
                    maxLength = max;
                }
                //the length of new non-dup substring;
                max -= position[indx] - startIndx;
                
                //New non-dup substring startIndex;
                startIndx = position[indx]+1;
            }
            position[indx] = i;
        }
        
        if(max > maxLength){
            maxLength = max;
        }
        
        return maxLength;
    }
    
};

